import Navbar from "./navbar";
import Head from "next/head";

const Layout = (props) => {
	return (
		<div>
			<Head>
				<title>Klinger Clinic</title>
			</Head>
			<Navbar></Navbar>
			{props.children}
		</div>
	);
};

export default Layout;
